import { useState, useEffect } from "react";

const Info = () => {
  const [data, setData] = useState(null);

  useEffect(() => {
    fetch("/users")
      .then((res) => res.json())
      .then((actualData) => setData(actualData));
  }, []);

  return (
    <div className="info-container">
      <div className="info-data-text">
        {!data ? (
          "Loading..."
        ) : (
          <div>
            <p>Username: {data[0].name}</p>
          </div>
        )}
      </div>
    </div>
  );
};

export default Info;
